import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Game_Clips from "../images/Game_Clips.png";
import { NavLink } from "react-router-dom";

const NavBar = () => {
  return (
    <div className="navBar">
      <nav>
        <ul>
          <li>
            <NavLink exact activeClassName="current" to="/">
              <button type="button" class="btn btn-outline-warning btn-lg" style = {{width: "80%"}}>
                HOME
              </button>
            </NavLink>
          </li>
          <li>
            <NavLink exact activeClassName="current" to="/game-list">
              <button type="button" class="btn btn-outline-warning">
                GAMES LIST
              </button>
            </NavLink>
          </li>
          <li>
            <NavLink exact activeClassName="current" to="/game-clips">
              <button type="button" class="btn btn-outline-warning">
                CLIPS GAMES
              </button>
            </NavLink>
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default NavBar;
